import Nav from "./Nav";
import Head from "next/head";

const Layout = ({ children }) => {
  return (
    <>
      <Head>
        <title>Specula</title>
        <meta charSet="UTF-8" />
        <meta author="Woo Young Choi" />
        <meta
          name="viewport"
          content="initial-scale=1.0, width=device-width"
          key="viewport"
        />
        <meta
          name="viewport"
          content="initial-scale=1.2, width=device-width"
          key="viewport"
        />
      </Head>
      <Nav />
      <div>{children}</div>
    </>
  );
};

export default Layout;
